import React from 'react';
import {
  AppRegistry,
  asset,
  Pano,
  View,
  Image,
  Video,
  VideoControl,
  MediaPlayerState,
} from 'react-vr';

class vr_player extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      playerState: new MediaPlayerState({autoPlay: true, muted: false})
    };
  }
  render() {
    return (
      <View style={{flex:1, flexDirection:'row'}}>
        <Pano source={asset('house.jpg')}/>
        <View style = {{
          alignItems: 'center',
          layoutOrigin: [0.5, 0.5, 0],
          transform: [{translate: [0, 0, -4]}],
        }}>
        <Video
        style={{height:2.25, width:4}}
        source= {{uri: 'https://s3.eu-central-1.amazonaws.com/react-video/video_dan.mp4'}}
        playerState={this.props.playerState}
        />

        <VideoControl style={{height:0.2, width:4}} 
            playerState={this.state.playerState}/>
        </View>

        <View style = {{
          alignItems: 'center',
          layoutOrigin: [0.5, 0.5, 0],
          transform: [{translate: [0, 1, -4]}],
        }}>
         <Image key='dan'  source={{uri: 'data:image/jpeg;base64,'}}
                style={{width: 1,
                        height: 1,
                }} />

            <Image
            source={{uri: 'data:image/jpeg;base64,'}}
            style={{
              width: 1,
              height:1,
            }}
            />      
        </View>

      </View>
    );
  }
};

AppRegistry.registerComponent('vr_player', () => vr_player);
